import React, { useState } from "react"
const Blog = ({ blog }) => {
  const [expand, setExpand] = useState(false)

  return (
    <div className="blog">
      {blog.title} {blog.author}{" "}
      <button onClick={() => setExpand(!expand)}>
        {expand ? "hide" : "view"}
      </button>
    </div>
  )
}

export default Blog
